import React from 'react';


function Card(props) {
  const { name, email } = props.robots;
  return (
    <div className="card">
  	  <img src='https://robohash.org/test?200x200' />
  	  <p>{name}</p>
  	  <p>{email}</p>        
    </div>
  );
}

export default Card;
